# Insert normalized data
INSERT INTO `TransactionMaster` (
     TransactionId
	, TransactionDate
    , PostedDate
    , AccountId
    , TypeId
    , Description
    , DescriptionManual
    , DescriptionDisplay
    , BudgetCycleId
    , IsAutoCategorized
    , IsUpdatedByUser
    , date_created
    , created_by
    , date_modified
    , modified_by
    , UserId
)
SELECT
      denormalized.TransactionId
    , denormalized.TransactionDate
    , denormalized.PostedDate
    , Account.AccountId
    , Type.TypeId
    , denormalized.Description
    , denormalized.DescriptionManual
    , denormalized.DescriptionDisplay
    , BudgetCycle.BudgetCycleId
    , denormalized.IsAutoCategorized
    , denormalized.IsUpdatedByUser
    , denormalized.date_created
    , denormalized.created_by
    , denormalized.date_modified
    , denormalized.modified_by
    , denormalized.UserId
FROM denormalized
LEFT OUTER JOIN Account
    ON Account.AccountNumber = denormalized.Account
LEFT OUTER JOIN Type
    ON Type.Name = denormalized.Type
    AND Type.ResourceType = 'T'
LEFT OUTER JOIN BudgetCycle
    ON BudgetCycle.BudgetCycle = denormalized.BudgetCycle
;


INSERT INTO TransactionDetail (
     TransactionId
	, Amount
    , BudgetId
    , Notes
    , date_created
    , created_by
    , date_modified
    , modified_by
    , UserId
)
SELECT
      denormalized.TransactionId
    , denormalized.Amount
    , Budget.BudgetId
    , denormalized.Notes
    , denormalized.date_created
    , denormalized.created_by
    , denormalized.date_modified
    , denormalized.modified_by
    , denormalized.UserId
FROM denormalized
LEFT OUTER JOIN TransactionMaster
	ON TransactionMaster.TransactionId = denormalized.TransactionId
LEFT OUTER JOIN BudgetCycle
    ON BudgetCycle.BudgetCycleId = TransactionMaster.BudgetCycleId
LEFT OUTER JOIN Budget
    ON Budget.Name = denormalized.Budget
    AND Budget.BudgetCycleId = TransactionMaster.BudgetCycleId
;

COMMIT;
